import React,{Component} from "react"

class Profile extends Component{
    
    state={
        user:[]
    }




    componentDidMount(){
            fetch("http://localhost:4000/profile/:id")
            .then(response => response.json())
            .then(data=>{
                this.setState({
                    user: data
                })
                console.log(data)
            })
    }
    
    
    render(){
        return(
            <div>
                    <ul>
                    {this.state.user.map(element => {

                        return(
                        <li key={element.user_id}>Name {element.fullname}</li>
                        )
                    })}
                    </ul>
            </div>
        )
    }
}



export default Profile
